import React from "react";
import PropTypes from 'prop-types'; 


export default function TextBoxStyle1({Name,placholder="أدخل النص",value,onChange,textBoxClassName}){
    return(
        <div>
        <input name={Name} value={value} onChange={onChange} type="text" placeholder={placholder} className={`bg-white border border-2 rounded-md text-[#374151] border-[#3B82F6] hover:border-[#60A5FA] focus:border-[#1D4ED8] focus:outline-none placeholder-[#9CA3AF] pl-1 ${textBoxClassName}`}/>
        </div>
    );
}

TextBoxStyle1.propTypes = {
    value: PropTypes.string.isRequired,
    onChange: PropTypes.func.isRequired,
};
